import styled, { css } from "styled-components"

const primaryColor = css`
    color:#448487
`
const Homepage = styled.div`

    margin:0 auto;
    ${primaryColor};
    .background{
        margin:30px 0;
        background-repeat:no-repeat;
        width: 100vw;
        height:700px
    }
`
export default Homepage
